// src/pages/Register.js
import React, { useState } from "react";
import api from "../api/api";
import { useNavigate, Link } from "react-router-dom";
import { useAuth } from "../context/AuthContext";
import toast from "react-hot-toast";
import logo from "../../assets/logo.png"; // <-- change to:

export default function Register() {
  const [form, setForm] = useState({
    name: "",
    phone: "",
    address: "",
    email: "",
    password: "",
    password_confirmation: "",
  });
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState(null);

  const navigate = useNavigate();
  const { login } = useAuth();

  const handleChange = (e) => {
    setForm((s) => ({ ...s, [e.target.name]: e.target.value }));
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    setLoading(true);
    setError(null);

    try {
      // Call register endpoint
      await api.post("/register", form);

      // After registration, auto-login the user using email/password
      // (Assuming your login endpoint accepts email + password)
      await login(form.email, form.password);

      toast.success("Account created ‚Äî welcome! üéâ");
      navigate("/"); // go to Home
    } catch (err) {
      console.error("Registration failed:", err);

      // Handle Laravel validation errors or message
      const backendMsg =
        err?.response?.data?.message ||
        (err?.response?.data?.errors && JSON.stringify(err.response.data.errors)) ||
        err?.message ||
        "Registration failed";

      setError(backendMsg);
      toast.error("Registration failed ‚ùå");
    } finally {
      setLoading(false);
    }
  };

  return (
    <div
      className="min-h-screen flex items-center justify-center bg-cover bg-center"
      style={{
        backgroundImage:
          "url('/assets/cakes-bg.jpg'), linear-gradient(rgba(0,0,0,0.6), rgba(0,0,0,0.6))",
        backgroundBlendMode: "darken",
      }}
    >
      <div className="bg-black bg-opacity-70 rounded-xl shadow-2xl p-8 w-full max-w-md flex flex-col items-center">
        <img src={logo} alt="Sweet Bite Logo" className="w-16 h-16 mb-2" />
        <h1 className="text-4xl font-bold text-[#e7bfa7] mb-2 font-cursive tracking-wide">
          Sweet Bite
        </h1>
        <h2 className="text-xl text-[#e7bfa7] mb-4 font-semibold">
          Create an Account
        </h2>
        {error && (
          <p className="text-red-400 text-sm mb-3 text-center">{error}</p>
        )}

        <form onSubmit={handleSubmit} className="w-full space-y-4">
          <input
            type="text"
            name="name"
            value={form.name}
            onChange={handleChange}
            required
            placeholder="Full Name"
            className="w-full px-4 py-3 rounded-lg bg-[#fff8f5] border-none focus:ring-2 focus:ring-[#e7bfa7] text-gray-800 text-base"
          />
          <input
            type="text"
            name="phone"
            value={form.phone}
            onChange={handleChange}
            required
            placeholder="Phone Number"
            className="w-full px-4 py-3 rounded-lg bg-[#fff8f5] border-none focus:ring-2 focus:ring-[#e7bfa7] text-gray-800 text-base"
          />
          <input
            type="text"
            name="address"
            value={form.address}
            onChange={handleChange}
            required
            placeholder="Address"
            className="w-full px-4 py-3 rounded-lg bg-[#fff8f5] border-none focus:ring-2 focus:ring-[#e7bfa7] text-gray-800 text-base"
          />
          <input
            type="email"
            name="email"
            value={form.email}
            onChange={handleChange}
            required
            placeholder="Email"
            className="w-full px-4 py-3 rounded-lg bg-[#fff8f5] border-none focus:ring-2 focus:ring-[#e7bfa7] text-gray-800 text-base"
          />
          <input
            type="password"
            name="password"
            value={form.password}
            onChange={handleChange}
            required
            placeholder="Password"
            className="w-full px-4 py-3 rounded-lg bg-[#fff8f5] border-none focus:ring-2 focus:ring-[#e7bfa7] text-gray-800 text-base"
          />
          <input
            type="password"
            name="password_confirmation"
            value={form.password_confirmation}
            onChange={handleChange}
            required
            placeholder="Confirm Password"
            className="w-full px-4 py-3 rounded-lg bg-[#fff8f5] border-none focus:ring-2 focus:ring-[#e7bfa7] text-gray-800 text-base"
          />
          <button
            type="submit"
            disabled={loading}
            className="w-full bg-[#7b3f00] hover:bg-[#a05a2c] text-white font-bold py-3 rounded-lg text-lg transition disabled:opacity-60"
          >
            {loading ? "Registering..." : "Create Account"}
          </button>
        </form>

        <p className="text-sm text-[#e7bfa7] text-center mt-4">
          Already have an account?{" "}
          <Link to="/login" className="text-[#e7bfa7] underline hover:text-white">
            Login
          </Link>
        </p>
      </div>
    </div>
  );
}
